INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('296','2020','7','28','Widenius Street','Money laundering took place at 20:30. No known witnesses.');
INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('297','2020','7','28','Humphrey Lane','Littering took place at 16:36. No known witnesses.');
INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('298','2020','7','29','Lloyd Lane','Insider trading took place at 06:35. One person witnessed the incident.');
INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('299','2020','7','30','Humphrey Lane','Littering took place at 17:49. Two people witnessed the event.');
INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('300','2020','7','31','Zlatkova Street','Bank robbery took place at 12:24. No known witnesses.');
INSERT INTO "crime_scene_reports" ("id","year","month","day","street","description") VALUES ('301','2020','8','1','Carvalho Road','Vandalism took place at 13:52. One person witnessed the incident.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('1','Melissa','2020','1','1','Then we have stopped all the holes. And now we must be silent and wait.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('2','Andrea','2020','1','2','Sherlock Holmes sat silent for a few minutes with his fingertips still pressed together, his legs stretched out in front of him, and his gaze directed upward to the ceiling. Then he took down from the rack the old and oily clay pipe, which was to him as a counsellor, and, having lit it, he leaned back in his chair, with the thick blue cloud-wreaths spinning up from him, and a look of infinite languor in his face.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('3','Abigail','2020','1','4','Well, said he, showing me the advertisement, you can see for yourself that the League has a vacancy, and there is the address where you should apply for particulars. As far as I can make out, the League was founded by an American millionaire, Ezekiah Hopkins, who was very peculiar in his ways. He was himself red-headed, and he had a great sympathy for all red-headed men; so, when he died, it was found that he had left his enormous fortune in the hands of trustees, with instructions to apply the interest to the providing of easy berths to men whose hair is of that colour. From all I hear it is splendid pay and very little to do.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('4','Douglas','2020','1','4','I smiled and shook my head. I can quite understand your thinking so, I said. Of course, in your position of unofficial adviser and helper to everybody who is absolutely puzzled, throughout three continents, you are brought in contact with all that is strange and bizarre. But hereI picked up the morning paper from the groundlet us put it to a practical test. Here is the first heading upon which I come. A husbands cruelty to his wife. There is half a column of print, but I know without reading it that it is all perfectly familiar to me. There is, of course, the other woman, the drink, the push, the blow, the bruise, the sympathetic sister or landlady. The crudest of writers could invent nothing more crude.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('5','Wayne','2020','1','6','You reasoned it out beautifully, I exclaimed in unfeigned admiration. It is so long a chain, and yet every link rings true.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('6','Laura','2020','1','7','A flush stole over Miss Sutherlands face, and she picked nervously at the fringe of her jacket. I met him first at the gasfitters ball, she said. They used to send father tickets when he was alive, and then afterwards they remembered us, and sent them to mother. Mr. Windibank did not wish us to go. He never did wish us to go anywhere. He would get quite mad if I wanted so much as to join a Sunday-school treat. But this time I was set on going, and I would go; for what right had he to prevent? He said the folk were not fit for us to know, when all fathers friends were to be there. And he said that I had nothing fit to wear, when I had my purple plush that I had never so much as taken out of the drawer. At last, when nothing else would do, he went off to France upon the business of the firm, but we went, mother and I, with Mr. Hardy, who used to be our foreman, and it was there I met Mr. Hosmer Angel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('7','Michelle','2020','1','9','I was still balancing the matter in my mind when a hansom cab drove up to Briony Lodge, and a gentleman sprang out. He was a remarkably handsome man, dark, aquiline, and moustachedevidently the man of whom I had heard. He appeared to be in a great hurry, shouted to the cabman to wait, and brushed past the maid who opened the door with the air of a man who was thoroughly at home.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('8','Sophia','2020','1','13','I never hope to see such a sight as that again, Mr. Holmes. From north, south, east, and west every man who had a shade of red in his hair had tramped into the city to answer the advertisement. Fleet Street was choked with red-headed folk, and Popes Court looked like a costers orange barrow. I should not have thought there were so many in the whole country as were brought together by that single advertisement. Every shade of colour they werestraw, lemon, orange, brick, Irish-setter, liver, clay; but, as Spaulding said, there were not many who had the real vivid flame-coloured tint. When I saw how many were waiting, I would have given it up in despair; but Spaulding would not hear of it. How he did it I could not imagine, but he pushed and pulled and butted until he got me through the crowd, and right up to the steps which led to the office. There was a double stream upon the stair, some going up in hope, and some coming back dejected; but we wedged in as well as we could and soon found ourselves in the office.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('9','Robert','2020','1','14','At first it was but a lurid spark upon the stone pavement. Then it lengthened out until it became a yellow line, and then, without any warning or sound, a gash seemed to open and a hand appeared, a white, almost womanly hand, which felt about in the centre of the little area of light. For a minute or more the hand, with its writhing fingers, protruded out of the floor. Then it was withdrawn as suddenly as it appeared, and all was dark again save the single lurid spark which marked a chink between the stones.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('10','David','2020','1','14','Holmes had sat up upon the couch, and I saw him motion like a man who is in need of air. A maid rushed across and threw open the window. At the same instant I saw him raise his hand and at the signal I tossed my rocket into the room with a cry of Fire! The word was no sooner out of my mouth than the whole crowd of spectators, well dressed and illgentlemen, ostlers, and servant maidsjoined in a general shriek of Fire! Thick clouds of smoke curled through the room and out at the open window. I caught a glimpse of rushing figures, and a moment later the voice of Holmes from within assuring them that it was a false alarm. Slipping through the shouting crowd I made my way to the corner of the street, and in ten minutes was rejoiced to find my friends arm in mine, and to get away from the scene of uproar. He walked swiftly and in silence for some few minutes until we had turned down one of the quiet streets which lead towards the Edgeware Road.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('11','Nancy','2020','1','16','Sherlock Holmes had sprung out and seized the intruder by the collar. The other dived down the hole, and I heard the sound of rending cloth as Jones clutched at his skirts. The light flashed upon the barrel of a revolver, but Holmes hunting crop came down on the mans wrist, and the pistol clinked upon the stone floor.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('12','Sean','2020','1','17','Hes a brave fellow, said a woman. They would have had the ladys purse and watch if it hadnt been for him. They were a gang, and a rough one, too. Ah, hes breathing now.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('13','Terry','2020','1','19','Never mind him. I may want your help, and so may he. Here he comes. Sit down in that armchair, Doctor, and give us your best attention.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('14','Anna','2020','1','23','Oh, well, he was very good about it. He laughed, I remember, and shrugged his shoulders, and said there was no use denying anything to a woman, for she would have her way.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('15','Brenda','2020','1','24','Thank God, he cried. Youll do. Come! Come!');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('16','Joyce','2020','1','24','The Church of St. Monica, John, she cried, and half a sovereign if you reach it in twenty minutes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('17','Johnny','2020','1','25','Pon my word, Watson, you are coming along wonderfully. You have really done very well indeed. It is true that you have missed everything of importance, but you have hit upon the method, and you have a quick eye for colour. Never trust to general impressions, my boy, but concentrate yourself upon details. My first glance is always at a womans sleeve. In a man it is perhaps better first to take the knee of the trouser. As you observe, this woman had plush upon her sleeves, which is a most useful material for showing traces. The double line a little above the wrist, where the typewritist presses against the table, was beautifully defined. The sewing-machine, of the hand type, leaves a similar mark, but only on the left arm, and on the side of it farthest from the thumb, instead of being right across the broadest part, as this was. I then glanced at her face, and, observing the dint of a pince-nez at either side of her nose, I ventured a remark upon short sight and typewriting, which seemed to surprise her.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('18','Diana','2020','1','28','He cant lie in the street. May we bring him in, marm?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('19','Katherine','2020','1','28','Why, indeed? murmured Holmes. Your Majesty had not spoken before I was aware that I was addressing Wilhelm Gottsreich Sigismond von Ormstein, Grand Duke of Cassel-Felstein, and hereditary King of Bohemia.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('20','Doris','2020','2','1','Who was he, then, and what was his object in deserting Miss Sutherland?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('21','Joan','2020','2','2','Had there been women in the house, I should have suspected a mere vulgar intrigue. That, however, was out of the question. The mans business was a small one, and there was nothing in his house which could account for such elaborate preparations, and such an expenditure as they were at. It must, then, be something out of the house. What could it be? I thought of the assistants fondness for photography, and his trick of vanishing into the cellar. The cellar! There was the end of this tangled clue. Then I made inquiries as to this mysterious assistant and found that I had to deal with one of the coolest and most daring criminals in London. He was doing something in the cellarsomething which took many hours a day for months on end. What could it be, once more? I could think of nothing save that he was running a tunnel to some other building.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('22','Harold','2020','2','2','You may address me as the Count Von Kramm, a Bohemian nobleman. I understand that this gentleman, your friend, is a man of honour and discretion, whom I may trust with a matter of the most extreme importance. If not, I should much prefer to communicate with you alone.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('23','Carol','2020','2','4','And the ring? I asked, glancing at a remarkable brilliant which sparkled upon his finger.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('24','Tyler','2020','2','4','Some cold beef and a glass of beer, he answered, ringing the bell. I have been too busy to think of food, and I am likely to be busier still this evening. By the way, Doctor, I shall want your co-operation.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('25','Evelyn','2020','2','4','You see, Watson, he explained in the early hours of the morning as we sat over a glass of whisky and soda in Baker Street, it was perfectly obvious from the first that the only possible object of this rather fantastic business of the advertisement of the League, and the copying of the Encyclopdia, must be to get this not over-bright pawnbroker out of the way for a number of hours every day. It was a curious way of managing it, but, really, it would be difficult to suggest a better. The method was no doubt suggested to Clays ingenious mind by the colour of his accomplices hair. The  4 a week was a lure which must draw him, and what was it to them, who were playing for thousands? They put in the advertisement, one rogue has the temporary office, the other rogue incites the man to apply for it, and together they manage to secure his absence every morning in the week. From the time that I heard of the assistant having come for half wages, it was obvious to me that he had some strong motive for securing the situation.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('26','James','2020','2','5','The circumstances are of great delicacy, and every precaution has to be taken to quench what might grow to be an immense scandal and seriously compromise one of the reigning families of Europe. To speak plainly, the matter implicates the great House of Ormstein, hereditary kings of Bohemia.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('27','Raymond','2020','2','6','Good-night, Mister Sherlock Holmes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('28','Jeremy','2020','2','6','It is our French gold, whispered the director. We have had several warnings that an attempt might be made upon it.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('29','Ralph','2020','2','7','You appeared to read a good deal upon her which was quite invisible to me, I remarked.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('30','Patrick','2020','2','7','Its disappearance, however, was but momentary. With a rending, tearing sound, one of the broad, white stones turned over upon its side and left a square, gaping hole, through which streamed the light of a lantern. Over the edge there peeped a clean-cut, boyish face, which looked keenly about it, and then, with a hand on either side of the aperture, drew itself shoulder-high and waist-high, until one knee rested upon the edge. In another instant he stood at the side of the hole and was hauling after him a companion, lithe and small like himself, with a pale face and a shock of very red hair.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('31','Bobby','2020','2','8','I was aware of it, said Holmes dryly.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('32','Sandra','2020','2','8','No, that was not the point. However, I shall write two letters, which should settle the matter. One is to a firm in the City, the other is to the young ladys stepfather, Mr. Windibank, asking him whether he could meet us here at six oclock to-morrow evening. It is just as well that we should do business with the male relatives. And now, Doctor, we can do nothing until the answers to those letters come, so we may put our little problem upon the shelf for the interim.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('33','Joshua','2020','2','9','I then lounged down the street and found, as I expected, that there was a mews in a lane which runs down by one wall of the garden. I lent the ostlers a hand in rubbing down their horses, and received in exchange twopence, a glass of half-and-half, two fills of shag tobacco, and as much information as I could desire about Miss Adler, to say nothing of half a dozen other people in the neighbourhood in whom I was not in the least interested, but whose biographies I was compelled to listen to.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('34','Kathryn','2020','2','10','I placed my revolver, cocked, upon the top of the wooden case behind which I crouched. Holmes shot the slide across the front of his lantern and left us in pitch darknesssuch an absolute darkness as I have never before experienced. The smell of hot metal remained to assure us that the light was still there, ready to flash out at a moments notice. To me, with my nerves worked up to a pitch of expectancy, there was something depressing and subduing in the sudden gloom, and in the cold dank air of the vault.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('35','Catherine','2020','2','11','I have an inspector and two officers waiting at the front door.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('36','Willie','2020','2','11','I work at the courthouse, and I saw the hit-and-run on my way into work this morning.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('37','Janice','2020','2','12','Some ten or twelve, but none which present any feature of interest. They are important, you understand, without being interesting. Indeed, I have found that it is usually in unimportant matters that there is a field for the observation, and for the quick analysis of cause and effect which gives the charm to an investigation. The larger crimes are apt to be the simpler, for the bigger the crime the more obvious, as a rule, is the motive. In these cases, save for one rather intricate matter which has been referred to me from Marseilles, there is nothing which presents any features of interest. It is possible, however, that I may have something better before very many minutes are over, for this is one of my clients, or I am much mistaken.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('38','Joseph','2020','2','12','You will excuse this mask, continued our strange visitor. The august person who employs me wishes his agent to be unknown to you, and I may confess at once that the title by which I have just called myself is not exactly my own.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('39','Dennis','2020','2','12','A man entered who could hardly have been less than six feet six inches in height, with the chest and limbs of a Hercules. His dress was rich with a richness which would, in England, be looked upon as akin to bad taste. Heavy bands of astrakhan were slashed across the sleeves and fronts of his double-breasted coat, while the deep blue cloak which was thrown over his shoulders was lined with flame-coloured silk and secured at the neck with a brooch which consisted of a single flaming beryl. Boots which extended halfway up his calves, and which were trimmed at the tops with rich brown fur, completed the impression of barbaric opulence which was suggested by his whole appearance. He carried a broad-brimmed hat in his hand, while he wore across the upper part of his face, extending down past the cheekbones, a black vizard mask, which he had apparently adjusted that very moment, for his hand was still raised to it as he entered. From the lower part of the face he appeared to be a man of strong character, with a thick, hanging lip, and a long, straight chin suggestive of resolution pushed to the length of obstinacy.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('40','Michael','2020','2','14','The man sat huddled up in his chair, with his head sunk upon his breast, like one who is utterly crushed. Holmes stuck his feet up on the corner of the mantelpiece and, leaning back with his hands in his pockets, began talking, rather to himself, as it seemed, than to us.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('41','Isabella','2020','2','15','It is most unlikely that she carries it about with her. It is cabinet size. Too large for easy concealment about a womans dress. She knows that the King is capable of having her waylaid and searched. Two attempts of the sort have already been made. We may take it, then, that she does not carry it about with her.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('42','Arthur','2020','2','15','Well, I found my plans very seriously menaced. It looked as if the pair might take an immediate departure, and so necessitate very prompt and energetic measures on my part. At the church door, however, they separated, he driving back to the Temple, and she to her own house. I shall drive out in the park at five as usual, she said as she left him. I heard no more. They drove away in different directions, and I went off to make my own arrangements.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('43','Nicholas','2020','2','20','You did it very nicely, Doctor, he remarked. Nothing could have been better. It is all right.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('44','Justin','2020','2','20','The question was hardly out of my mouth, and Holmes had not yet opened his lips to reply, when we heard a heavy footfall in the passage and a tap at the door.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('45','Kayla','2020','2','21','You have the photograph?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('46','Scott','2020','2','23','Well, when they closed their League offices that was a sign that they cared no longer about Mr. Jabez Wilsons presencein other words, that they had completed their tunnel. But it was essential that they should use it soon, as it might be discovered, or the bullion might be removed. Saturday would suit them better than any other day, as it would give them two days for their escape. For all these reasons I expected them to come to-night.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('47','Emily','2020','2','23','I am very much afraid that it is not. But between ourselves, Windibank, it was as cruel and selfish and heartless a trick in a petty way as ever came before me. Now, let me just run over the course of events, and you will contradict me if I go wrong.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('48','Dylan','2020','2','24','No, no, the mystery! I cried.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('49','Peter','2020','2','24','They have but one retreat, whispered Holmes. That is back through the house into Saxe-Coburg Square. I hope that you have done what I asked you, Jones?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('50','Jennifer','2020','2','25','I left him then, still puffing at his black clay pipe, with the conviction that when I came again on the next evening I would find that he held in his hands all the clues which would lead up to the identity of the disappearing bridegroom of Miss Mary Sutherland.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('51','Kimberly','2020','2','27','Oh, yes, mother is alive and well. I wasnt best pleased, Mr. Holmes, when she married again so soon after fathers death, and a man who was nearly fifteen years younger than herself. Father was a plumber in the Tottenham Court Road, and he left a tidy business behind him, which mother carried on with Mr. Hardy, the foreman; but when Mr. Windibank came he made her sell the business, for he was very superior, being a traveller in wines. They got  4700 for the goodwill and interest, which wasnt near as much as father could have got if he had been alive.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('52','Kyle','2020','3','2','And sit in the dark?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('53','Billy','2020','3','2','You have made your position very clear to me, said Holmes. This is my friend, Dr. Watson, before whom you can speak as freely as before myself. Kindly tell us now all about your connection with Mr. Hosmer Angel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('54','Judith','2020','3','4','I have seen those symptoms before, said Holmes, throwing his cigarette into the fire. Oscillation upon the pavement always means an affaire de cur. She would like advice, but is not sure that the matter is not too delicate for communication. And yet even here we may discriminate. When a woman has been seriously wronged by a man she no longer oscillates, and the usual symptom is a broken bell wire. Here we may take it that there is a love matter, but that the maiden is not so much angry as perplexed, or grieved. But here she comes in person to resolve our doubts.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('55','Jonathan','2020','3','6','Not invisible but unnoticed, Watson. You did not know where to look, and so you missed all that was important. I can never bring you to realise the importance of sleeves, the suggestiveness of thumb-nails, or the great issues that may hang from a boot-lace. Now, what did you gather from that womans appearance? Describe it.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('56','Jessica','2020','3','9','Our visitor glanced with some apparent surprise at the languid, lounging figure of the man who had been no doubt depicted to him as the most incisive reasoner and most energetic agent in Europe. Holmes slowly reopened his eyes and looked impatiently at his gigantic client.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('57','Jacqueline','2020','3','12','I had expected to see Sherlock Holmes impatient under this rambling and inconsequential narrative, but, on the contrary, he had listened with the greatest concentration of attention.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('58','Lisa','2020','3','13','This was quite too good to lose, Watson. I was just balancing whether I should run for it, or whether I should perch behind her landau when a cab came through the street. The driver looked twice at such a shabby fare, but I jumped in before he could object. The Church of St. Monica, said I, and half a sovereign if you reach it in twenty minutes. It was twenty-five minutes to twelve, and of course it was clear enough what was in the wind.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('59','Julia','2020','3','13','You are not very vulnerable from above, Holmes remarked as he held up the lantern and gazed about him.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('60','Heather','2020','3','16','My name, said he, is Mr. Duncan Ross, and I am myself one of the pensioners upon the fund left by our noble benefactor. Are you a married man, Mr. Wilson? Have you a family?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('61','Jason','2020','3','16','The man sprang from his chair and paced up and down the room in uncontrollable agitation. Then, with a gesture of desperation, he tore the mask from his face and hurled it upon the ground. You are right, he cried; I am the King. Why should I attempt to conceal it?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('62','Matthew','2020','3','17','Yes. It was the bisulphate of baryta.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('63','Jean','2020','3','18','He held out his snuffbox of old gold, with a great amethyst in the centre of the lid. Its splendour was in such contrast to his homely ways and simple life that I could not help commenting upon it.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('64','Rose','2020','3','18','I rose to go, but Holmes caught me by the wrist and pushed me back into my chair. It is both, or none, said he. You may say before this gentleman anything which you may say to me.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('65','Brian','2020','3','18','Slowly and solemnly he was borne into Briony Lodge and laid out in the principal room, while I still observed the proceedings from my post by the window. The lamps had been lit, but the blinds had not been drawn, so that I could see Holmes as he lay upon the couch. I do not know whether he was seized with compunction at that moment for the part he was playing, but I know that I never felt more heartily ashamed of myself in my life than when I saw the beautiful creature against whom I was conspiring, or the grace and kindliness with which she waited upon the injured man. And yet it would be the blackest treachery to Holmes to draw back now from the part which he had intrusted to me. I hardened my heart, and took the smoke-rocket from under my ulster. After all, I thought, we are not injuring her. We are but preventing her from injuring another.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('66','Theresa','2020','3','19','At eight in the morning. She will not be up, so that we shall have a clear field. Besides, we must be prompt, for this marriage may mean a complete change in her life and habits. I must wire to the King without delay.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('67','Pamela','2020','3','21','A pair, by the sound, said he. Yes, he continued, glancing out of the window. A nice little brougham and a pair of beauties. A hundred and fifty guineas apiece. Theres money in this case, Watson, if there is nothing else.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('68','Olivia','2020','3','21','This Godfrey Norton was evidently an important factor in the matter. He was a lawyer. That sounded ominous. What was the relation between them, and what the object of his repeated visits? Was she his client, his friend, or his mistress? If the former, she had probably transferred the photograph to his keeping. If the latter, it was less likely. On the issue of this question depended whether I should continue my work at Briony Lodge, or turn my attention to the gentlemans chambers in the Temple. It was a delicate point, and it widened the field of my inquiry. I fear that I bore you with these details, but I have to let you see my little difficulties, if you are to understand the situation.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('69','Edward','2020','3','24','My friend was an enthusiastic musician, being himself not only a very capable performer but a composer of no ordinary merit. All the afternoon he sat in the stalls wrapped in the most perfect happiness, gently waving his long, thin fingers in time to the music, while his gently smiling face and his languid, dreamy eyes were as unlike those of Holmes the sleuth-hound, Holmes the relentless, keen-witted, ready-handed criminal agent, as it was possible to conceive. In his singular character the dual nature alternately asserted itself, and his extreme exactness and astuteness represented, as I have often thought, the reaction against the poetic and contemplative mood which occasionally predominated in him. The swing of his nature took him from extreme languor to devouring energy; and, as I knew well, he was never so truly formidable as when, for days on end, he had been lounging in his armchair amid his improvisations and his black-letter editions. Then it was that the lust of the chase would suddenly come upon him, and that his brilliant reasoning power would rise to the level of intuition, until those who were unacquainted with his methods would look askance at him as on a man whose knowledge was not that of other mortals. When I saw him that afternoon so enwrapped in the music at St. Jamess Hall I felt that an evil time might be coming upon those whom he had set himself to hunt down.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('70','Kathleen','2020','3','25','A slow and heavy step, which had been heard upon the stairs and in the passage, paused immediately outside the door. Then there was a loud and authoritative tap.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('71','Walter','2020','3','26','The Count shrugged his broad shoulders. Then I must begin, said he, by binding you both to absolute secrecy for two years; at the end of that time the matter will be of no importance. At present it is not too much to say that it is of such weight it may have an influence upon European history.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('72','Noah','2020','3','27','Oh, no, sir. It is quite separate and was left me by my uncle Ned in Auckland. It is in New Zealand stock, paying 4 per cent. Two thousand five hundred pounds was the amount, but I can only touch the interest.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('73','Danielle','2020','3','28','Indeed, your example is an unfortunate one for your argument, said Holmes, taking the paper and glancing his eye down it. This is the Dundas separation case, and, as it happens, I was engaged in clearing up some small points in connection with it. The husband was a teetotaler, there was no other woman, and the conduct complained of was that he had drifted into the habit of winding up every meal by taking out his false teeth and hurling them at his wife, which, you will allow, is not an action likely to occur to the imagination of the average story-teller. Take a pinch of snuff, Doctor, and acknowledge that I have scored over you in your example.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('74','William','2020','4','1','Away they went, and I was just wondering whether I should not do well to follow them when up the lane came a neat little landau, the coachman with his coat only half-buttoned, and his tie under his ear, while all the tags of his harness were sticking out of the buckles. It hadnt pulled up before she shot out of the hall door and into it. I only caught a glimpse of her at the moment, but she was a lovely woman, with a face that a man might die for.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('75','Alan','2020','4','4','Kindly look her up in my index, Doctor, murmured Holmes without opening his eyes. For many years he had adopted a system of docketing all paragraphs concerning men and things, so that it was difficult to name a subject or a person on which he could not at once furnish information. In this case I found her biography sandwiched in between that of a Hebrew rabbi and that of a staff-commander who had written a monograph upon the deep-sea fishes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('76','Stephanie','2020','4','4','Which were very well justified, observed Holmes. And now it is time that we arranged our little plans. I expect that within an hour matters will come to a head. In the meantime Mr. Merryweather, we must put the screen over that dark lantern.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('77','Andrew','2020','4','5','She will not be able to. But I hear the rumble of wheels. It is her carriage. Now carry out my orders to the letter.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('78','Rachel','2020','4','7','But, said I, there would be millions of red-headed men who would apply.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('79','Madison','2020','4','8','Quite an interesting study, that maiden, he observed. I found her more interesting than her little problem, which, by the way, is rather a trite one. You will find parallel cases, if you consult my index, in Andover in 77, and there was something of the sort at The Hague last year. Old as is the idea, however, there were one or two details which were new to me. But the maiden herself was most instructive.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('80','Zachary','2020','4','10','I will not look.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('81','Alexander','2020','4','10','Well, have you solved it? I asked as I entered.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('82','Ronald','2020','4','11','There was nothing in the office but a couple of wooden chairs and a deal table, behind which sat a small man with a head that was even redder than mine. He said a few words to each candidate as he came up, and then he always managed to find some fault in them which would disqualify them. Getting a vacancy did not seem to be such a very easy matter, after all. However, when our turn came the little man was much more favourable to me than to any of the others, and he closed the door as we entered, so that he might have a private word with us.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('83','Amber','2020','4','11','As he spoke there was the sharp sound of horses hoofs and grating wheels against the curb, followed by a sharp pull at the bell. Holmes whistled.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('84','Eric','2020','4','12','Pray take a seat, said Holmes. This is my friend and colleague, Dr. Watson, who is occasionally good enough to help me in my cases. Whom have I the honour to address?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('85','John','2020','4','13','Is the poor gentleman much hurt? she asked.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('86','Christina','2020','4','14','I was half-dragged up to the altar, and before I knew where I was I found myself mumbling responses which were whispered in my ear, and vouching for things of which I knew nothing, and generally assisting in the secure tying up of Irene Adler, spinster, to Godfrey Norton, bachelor. It was all done in an instant, and there was the gentleman thanking me on the one side and the lady on the other, while the clergyman beamed on me in front. It was the most preposterous position in which I ever found myself in my life, and it was the thought of it that started me laughing just now. It seems that there had been some informality about their license, that the clergyman absolutely refused to marry them without a witness of some sort, and that my lucky appearance saved the bridegroom from having to sally out into the streets in search of a best man. The bride gave me a sovereign, and I mean to wear it on my watch chain in memory of the occasion.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('87','Lauren','2020','4','14','There are three men waiting for him at the door, said Holmes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('88','Donald','2020','4','17','Not a bit, Doctor. Stay where you are. I am lost without my Boswell. And this promises to be interesting. It would be a pity to miss it.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('89','Albert','2020','4','19','I had had so many reasons to believe in my friends subtle powers of reasoning and extraordinary energy in action that I felt that he must have some solid grounds for the assured and easy demeanour with which he treated the singular mystery which he had been called upon to fathom. Once only had I known him to fail, in the case of the King of Bohemia and of the Irene Adler photograph; but when I looked back to the weird business of the Sign of Four, and the extraordinary circumstances connected with the Study in Scarlet, I felt that it would be a strange tangle indeed which he could not unravel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('90','Carl','2020','4','19','What a time it seemed! From comparing notes afterwards it was but an hour and a quarter, yet it appeared to me that the night must have almost gone, and the dawn be breaking above us. My limbs were weary and stiff, for I feared to change my position; yet my nerves were worked up to the highest pitch of tension, and my hearing was so acute that I could not only hear the gentle breathing of my companions, but I could distinguish the deeper, heavier in-breath of the bulky Jones from the thin, sighing note of the bank director. From my position I could look over the case in the direction of the floor. Suddenly my eyes caught the glint of a light.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('91','Gloria','2020','4','20','Her banker or her lawyer. There is that double possibility. But I am inclined to think neither. Women are naturally secretive, and they like to do their own secreting. Why should she hand it over to anyone else? She could trust her own guardianship, but she could not tell what indirect or political influence might be brought to bear upon a business man. Besides, remember that she had resolved to use it within a few days. It must be where she can lay her hands upon it. It must be in her own house.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('92','Julie','2020','4','20','I saw him talking on the phone outside the courthouse at 3:00pm.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('93','Natalie','2020','4','22','And yet I am not convinced of it, I answered. The cases which come to light in the papers are, as a rule, bald enough, and vulgar enough. We have in our police reports realism pushed to its extreme limits, and yet the result is, it must be confessed, neither fascinating nor artistic.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('94','Victoria','2020','4','22','On the contrary, said Holmes quietly; I have every reason to believe that I will succeed in discovering Mr. Hosmer Angel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('95','Anthony','2020','4','22','Well, she had a slate-coloured, broad-brimmed straw hat, with a feather of a brickish red. Her jacket was black, with black beads sewn upon it, and a fringe of little black jet ornaments. Her dress was brown, rather darker than coffee colour, with a little purple plush at the neck and sleeves. Her gloves were greyish and were worn through at the right forefinger. Her boots I didnt observe. She had small round, hanging gold earrings, and a general air of being fairly well-to-do in a vulgar, comfortable, easy-going way.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('96','Nathan','2020','4','25','Quite so; but the sequel was rather unusual. I will tell you, however. I left the house a little after eight oclock this morning in the character of a groom out of work. There is a wonderful sympathy and freemasonry among horsey men. Be one of them, and you will know all that there is to know. I soon found Briony Lodge. It is a bijou villa, with a garden at the back, but built out in front right up to the road, two stories. Chubb lock to the door. Large sitting-room on the right side, well furnished, with long windows almost to the floor, and those preposterous English window fasteners which a child could open. Behind there was nothing remarkable, save that the passage window could be reached from the top of the coach-house. I walked round it and examined it closely from every point of view, but without noting anything else of interest.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('97','Samantha','2020','4','25','Youll see your pal again presently, said Jones. Hes quicker at climbing down holes than I am. Just hold out while I fix the derbies.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('98','Thomas','2020','4','26','I see. Then at the gasfitters ball you met, as I understand, a gentleman called Mr. Hosmer Angel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('99','Betty','2020','4','26','Then, when the row broke out, I had a little moist red paint in the palm of my hand. I rushed forward, fell down, clapped my hand to my face, and became a piteous spectacle. It is an old trick.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('100','Alexis','2020','5','1','And he is admirably suited for it, the other answered. He has every requirement. I cannot recall when I have seen anything so fine. He took a step backward, cocked his head on one side, and gazed at my hair until I felt quite bashful. Then suddenly he plunged forward, wrung my hand, and congratulated me warmly on my success.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('101','Carolyn','2020','5','1','Its no use, John Clay, said Holmes blandly. You have no chance at all.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('102','Grace','2020','5','2','Its all clear, he whispered. Have you the chisel and the bags? Great Scott! Jump, Archie, jump, and Ill swing for it!');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('103','Cheryl','2020','5','4','Sherlock Holmes clapped his hands softly together and chuckled.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('104','Marilyn','2020','5','6','Ive heard that voice before, said Holmes, staring down the dimly lit street. Now, I wonder who the deuce that could have been.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('105','Mary','2020','5','10','Its quite too funny. I am sure you could never guess how I employed my morning, or what I ended by doing.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('106','Paul','2020','5','11','And have you any on hand just now? I asked with interest.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('107','Martha','2020','5','12','At three oclock precisely I was at Baker Street, but Holmes had not yet returned. The landlady informed me that he had left the house shortly after eight oclock in the morning. I sat down beside the fire, however, with the intention of awaiting him, however long he might be. I was already deeply interested in his inquiry, for, though it was surrounded by none of the grim and strange features which were associated with the two crimes which I have already recorded, still, the nature of the case and the exalted station of his client gave it a character of its own. Indeed, apart from the nature of the investigation which my friend had on hand, there was something in his masterly grasp of a situation, and his keen, incisive reasoning, which made it a pleasure to me to study his system of work, and to follow the quick, subtle methods by which he disentangled the most inextricable mysteries. So accustomed was I to his invariable success that the very possibility of his failing had ceased to enter into my head.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('108','Alice','2020','5','12','Sherlock Holmes was not very communicative during the long drive and lay back in the cab humming the tunes which he had heard in the afternoon. We rattled through an endless labyrinth of gas-lit streets until we emerged into Farrington Street.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('109','Gregory','2020','5','12','The solemn Mr. Merryweather perched himself upon a crate, with a very injured expression upon his face, while Holmes fell upon his knees upon the floor and, with the lantern and a magnifying lens, began to examine minutely the cracks between the stones. A few seconds sufficed to satisfy him, for he sprang to his feet again and put his glass in his pocket.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('110','Austin','2020','5','13','So I see, the other answered with the utmost coolness. I fancy that my pal is all right, though I see you have got his coat-tails.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('111','Nicole','2020','5','14','But how could you guess what the motive was?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('112','Gabriel','2020','5','18','I do not wish to make a mystery, said he, laughing. The matter was perfectly simple. You, of course, saw that everyone in the street was an accomplice. They were all engaged for the evening.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('113','Jack','2020','5','18','Let me see, said Holmes, standing at the corner and glancing along the line, I should like just to remember the order of the houses here. It is a hobby of mine to have an exact knowledge of London. There is Mortimers, the tobacconist, the little newspaper shop, the Coburg branch of the City and Suburban Bank, the Vegetarian Restaurant, and McFarlanes carriage-building depot. That carries us right on to the other block. And now, Doctor, weve done our work, so its time we had some play. A sandwich and a cup of coffee, and then off to violin-land, where all is sweetness and delicacy and harmony, and there are no red-headed clients to vex us with their conundrums.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('114','Sara','2020','5','19','I could do with much less than that, Mr. Holmes, but you understand that as long as I live at home I dont wish to be a burden to them, and so they have the use of the money just while I am staying with them. Of course, that is only just for the time. Mr. Windibank draws my interest every quarter and pays it over to mother, and I find that I can do pretty well with what I earn at typewriting. It brings me twopence a sheet, and I can often do from fifteen to twenty sheets in a day.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('115','Richard','2020','5','20','This is the girls stepfather, Mr. James Windibank, said Holmes. He has written to me to say that he would be here at six. Come in!');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('116','Patricia','2020','5','27','But, surely, it was obvious. I was then much surprised and interested on glancing down to observe that, though the boots which she was wearing were not unlike each other, they were really odd ones; the one having a slightly decorated toe-cap, and the other a plain one. One was buttoned only in the two lower buttons out of five, and the other at the first, third, and fifth. Now, when you see that a young lady, otherwise neatly dressed, has come away from home with odd boots, half-buttoned, it is no great deduction to say that she came away in a hurry.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('117','Juan','2020','5','27','I cant imagine. I suppose that you have been watching the habits, and perhaps the house, of Miss Irene Adler.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('118','Ryan','2020','5','27','It was close upon four before the door opened, and a drunken-looking groom, ill-kempt and side-whiskered, with an inflamed face and disreputable clothes, walked into the room. Accustomed as I was to my friends amazing powers in the use of disguises, I had to look three times before I was certain that it was indeed he. With a nod he vanished into the bedroom, whence he emerged in five minutes tweed-suited and respectable, as of old. Putting his hands into his pockets, he stretched out his legs in front of the fire and laughed heartily for some minutes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('119','Aaron','2020','6','1','This is Mr. Jabez Wilson, said my assistant, and he is willing to fill a vacancy in the League.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('120','Kevin','2020','6','2','I know where it is.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('121','Stephen','2020','6','2','Then they carried me in. She was bound to have me in. What else could she do? And into her sitting-room, which was the very room which I suspected. It lay between that and her bedroom, and I was determined to see which. They laid me on a couch, I motioned for air, they were compelled to open the window, and you had your chance.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('122','Timothy','2020','6','5','Do you not find, he said, that with your short sight it is a little trying to do so much typewriting?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('123','Henry','2020','6','6','We have at least an hour before us, he remarked, for they can hardly take any steps until the good pawnbroker is safely in bed. Then they will not lose a minute, for the sooner they do their work the longer time they will have for their escape. We are at present, Doctoras no doubt you have divinedin the cellar of the City branch of one of the principal London banks. Mr. Merryweather is the chairman of directors, and he will explain to you that there are reasons why the more daring criminals of London should take a considerable interest in this cellar at present.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('124','Megan','2020','6','9','Let me see! said Holmes. Hum! Born in New Jersey in the year 1858. Contraltohum! La Scala, hum! Prima donna Imperial Opera of Warsawyes! Retired from operatic stageha! Living in Londonquite so! Your Majesty, as I understand, became entangled with this young person, wrote her some compromising letters, and is now desirous of getting those letters back.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('125','Debra','2020','6','11','And you are a benefactor of the race, said I.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('126','Mark','2020','6','13','Now, it is a fact, gentlemen, as you may see for yourselves, that my hair is of a very full and rich tint, so that it seemed to me that if there was to be any competition in the matter I stood as good a chance as any man that I had ever met. Vincent Spaulding seemed to know so much about it that I thought he might prove useful, so I just ordered him to put up the shutters for the day and to come right away with me. He was very willing to have a holiday, so we shut the business up and started off for the address that was given us in the advertisement.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('127','Beverly','2020','6','14','A certain selection and discretion must be used in producing a realistic effect, remarked Holmes. This is wanting in the police report, where more stress is laid, perhaps, upon the platitudes of the magistrate than upon the details, which to an observer contain the vital essence of the whole matter. Depend upon it, there is nothing so unnatural as the commonplace.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('128','Jordan','2020','6','19','Yes. We had occasion some months ago to strengthen our resources and borrowed for that purpose 30,000 napoleons from the Bank of France. It has become known that we have never had occasion to unpack the money, and that it is still lying in our cellar. The crate upon which I sit contains 2,000 napoleons packed between layers of lead foil. Our reserve of bullion is much larger at present than is usually kept in a single branch office, and the directors have had misgivings upon the subject.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('129','Emma','2020','6','20','The road in which we found ourselves as we turned round the corner from the retired Saxe-Coburg Square presented as great a contrast to it as the front of a picture does to the back. It was one of the main arteries which conveyed the traffic of the City to the north and west. The roadway was blocked with the immense stream of commerce flowing in a double tide inward and outward, while the footpaths were black with the hurrying swarm of pedestrians. It was difficult to realise as we looked at the line of fine shops and stately business premises that they really abutted on the other side upon the faded and stagnant square which we had just quitted.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('130','Ashley','2020','6','21','What then? I asked.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('131','Jerry','2020','6','22','We do all our correspondence with this machine at the office, and no doubt it is a little worn, our visitor answered, glancing keenly at Holmes with his bright little eyes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('132','Aaron','2020','6','25','But you can understand, said our strange visitor, sitting down once more and passing his hand over his high white forehead, you can understand that I am not accustomed to doing such business in my own person. Yet the matter was so delicate that I could not confide it to an agent without putting myself in his power. I have come incognito from Prague for the purpose of consulting you.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('133','Margaret','2020','6','25','It saved me from ennui, he answered, yawning. Alas! I already feel it closing in upon me. My life is spent in one long effort to escape from the commonplaces of existence. These little problems help me to do so.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('134','Deborah','2020','6','25','Our quest is practically finished. I shall call with the King to-morrow, and with you, if you care to come with us. We will be shown into the sitting-room to wait for the lady, but it is probable that when she comes she may find neither us nor the photograph. It might be a satisfaction to his Majesty to regain it with his own hands.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('135','Jesse','2020','6','28','I must really ask you to be a little more quiet! said Holmes severely. You have already imperilled the whole success of our expedition. Might I beg that you would have the goodness to sit down upon one of those boxes, and not to interfere?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('136','Judy','2020','6','28','So far I had got when we went to visit the scene of action. I surprised you by beating upon the pavement with my stick. I was ascertaining whether the cellar stretched out in front or behind. It was not in front. Then I rang the bell, and, as I hoped, the assistant answered it. We have had some skirmishes, but we had never set eyes upon each other before. I hardly looked at his face. His knees were what I wished to see. You must yourself have remarked how worn, wrinkled, and stained they were. They spoke of those hours of burrowing. The only remaining point was what they were burrowing for. I walked round the corner, saw the City and Suburban Bank abutted on our friends premises, and felt that I had solved my problem. When you drove home after the concert I called upon Scotland Yard and upon the chairman of the bank directors, with the result that you have seen.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('137','Frank','2020','6','28','That also I could fathom.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('138','Ruth','2020','7','1','I will get her to show me.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('139','Bruce','2020','7','2','We are close there now, my friend remarked. This fellow Merryweather is a bank director, and personally interested in the matter. I thought it as well to have Jones with us also. He is not a bad fellow, though an absolute imbecile in his profession. He has one positive virtue. He is as brave as a bulldog and as tenacious as a lobster if he gets his claws upon anyone. Here we are, and they are waiting for us.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('140','Ethan','2020','7','3','Your French gold?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('141','Cynthia','2020','7','3','A professional case of great gravity was engaging my own attention at the time, and the whole of next day I was busy at the bedside of the sufferer. It was not until close upon six oclock that I found myself free and was able to spring into a hansom and drive to Baker Street, half afraid that I might be too late to assist at the dnouement of the little mystery. I found Sherlock Holmes alone, however, half asleep, with his long, thin form curled up in the recesses of his armchair. A formidable array of bottles and test-tubes, with the pungent cleanly smell of hydrochloric acid, told me that he had spent his day in the chemical work which was so dear to him.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('142','Randy','2020','7','5','My cabby drove fast. I dont think I ever drove faster, but the others were there before us. The cab and the landau with their steaming horses were in front of the door when I arrived. I paid the man and hurried into the church. There was not a soul there save the two whom I had followed and a surpliced clergyman, who seemed to be expostulating with them. They were all three standing in a knot in front of the altar. I lounged up the side aisle like any other idler who has dropped into a church. Suddenly, to my surprise, the three at the altar faced round to me, and Godfrey Norton came running as hard as he could towards me.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('143','Philip','2020','7','6','It was from the reigning family of Holland, though the matter in which I served them was of such delicacy that I cannot confide it even to you, who have been good enough to chronicle one or two of my little problems.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('144','Jacob','2020','7','9','John Clay, the murderer, thief, smasher, and forger. Hes a young man, Mr. Merryweather, but he is at the head of his profession, and I would rather have my bracelets on him than on any criminal in London. Hes a remarkable man, is young John Clay. His grandfather was a royal duke, and he himself has been to Eton and Oxford. His brain is as cunning as his fingers, and though we meet signs of him at every turn, we never know where to find the man himself. Hell crack a crib in Scotland one week, and be raising money to build an orphanage in Cornwall the next. Ive been on his track for years and have never set eyes on him yet.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('145','Benjamin','2020','7','9','Surely. Bring him into the sitting-room. There is a comfortable sofa. This way, please!');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('146','Frances','2020','7','12','Good-evening, Mr. James Windibank, said Holmes. I think that this typewritten letter is from you, in which you made an appointment with me for six oclock?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('147','Helen','2020','7','12','You interest me extremely, said Holmes. And since you draw so large a sum as a hundred a year, with what you earn into the bargain, you no doubt travel a little and indulge yourself in every way. I believe that a single lady can get on very nicely upon an income of about  60.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('148','Brittany','2020','7','14','I am afraid so. I had brought a pack of cards in my pocket, and I thought that, as we were a partie carre, you might have your rubber after all. But I see that the enemys preparations have gone so far that we cannot risk the presence of a light. And, first of all, we must choose our positions. These are daring men, and though we shall take them at a disadvantage, they may do us some harm unless we are careful. I shall stand behind this crate, and do you conceal yourselves behind those. Then, when I flash a light upon them, close in swiftly. If they fire, Watson, have no compunction about shooting them down.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('149','Sharon','2020','7','14','It surprised me.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('150','Gerald','2020','7','14','We had reached Baker Street and had stopped at the door. He was searching his pockets for the key when someone passing said:');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('151','Ann','2020','7','19','If your Majesty would condescend to state your case, he remarked, I should be better able to advise you.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('152','George','2020','7','19','The facts are briefly these: Some five years ago, during a lengthy visit to Warsaw, I made the acquaintance of the well-known adventuress, Irene Adler. The name is no doubt familiar to you.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('153','Lawrence','2020','7','22','Pshaw! They did not know how to look.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('154','Samuel','2020','7','22','Your experience has been a most entertaining one, remarked Holmes as his client paused and refreshed his memory with a huge pinch of snuff. Pray continue your very interesting statement.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('155','Christopher','2020','7','23','He disappeared into his bedroom and returned in a few minutes in the character of an amiable and simple-minded Nonconformist clergyman. His broad black hat, his baggy trousers, his white tie, his sympathetic smile, and general look of peering and benevolent curiosity were such as Mr. John Hare alone could have equalled. It was not merely that Holmes changed his costume. His expression, his manner, his very soul seemed to vary with every fresh part that he assumed. The stage lost a fine actor, even as science lost an acute reasoner, when he became a specialist in crime.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('156','Steven','2020','7','26','No, no, theres life in him! shouted another. But hell be gone before you can get him to hospital.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('157','Charlotte','2020','7','27','He was in the house about half an hour, and I could catch glimpses of him in the windows of the sitting-room, pacing up and down, talking excitedly, and waving his arms. Of her I could see nothing. Presently he emerged, looking even more flurried than before. As he stepped up to the cab, he pulled a gold watch from his pocket and looked at it earnestly, Drive like the devil, he shouted, first to Gross & Hankeys in Regent Street, and then to the Church of St. Monica in the Edgeware Road. Half a guinea if you do it in twenty minutes!');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('158','Jose','2020','7','28','Ah, said he, I forgot that I had not seen you for some weeks. It is a little souvenir from the King of Bohemia in return for my assistance in the case of the Irene Adler papers.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('159','Eugene','2020','7','28','I suppose, said Holmes, that when Mr. Windibank came back from France he was very annoyed at your having gone to the ball.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('160','Barbara','2020','7','28','You had my note? he asked with a deep harsh voice and a strongly marked German accent. I told you that I would call. He looked from one to the other of us, as if uncertain which to address.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('161','Ruth','2020','7','28','Sometime within ten minutes of the theft, I saw the thief get into a car in the courthouse parking lot and drive away. If you have security footage from the courthouse parking lot, you might want to look for cars that left the parking lot in that time frame.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('162','Eugene','2020','7','28','I don''t know the thief''s name, but it was someone I recognized. Earlier this morning, before I arrived at the courthouse, I was walking by the ATM on Fifer Street and saw the thief there withdrawing some money.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('163','Raymond','2020','7','28','As the thief was leaving the courthouse, they called someone who talked to them for less than a minute. In the call, I heard the thief say that they were planning to take the earliest flight out of Fiftyville tomorrow. The thief then asked the person on the other end of the phone to purchase the flight ticket.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('164','Teresa','2020','8','1','Come, man, come, only three minutes, or it wont be legal.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('165','Karen','2020','8','2','And how could you tell that they would make their attempt to-night? I asked.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('166','Dorothy','2020','8','2','She showed me, as I told you she would.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('167','Bryan','2020','8','4','We had reached the same crowded thoroughfare in which we had found ourselves in the morning. Our cabs were dismissed, and, following the guidance of Mr. Merryweather, we passed down a narrow passage and through a side door, which he opened for us. Within there was a small corridor, which ended in a very massive iron gate. This also was opened, and led down a flight of winding stone steps, which terminated at another formidable gate. Mr. Merryweather stopped to light a lantern, and then conducted us down a dark, earth-smelling passage, and so, after opening a third door, into a huge vault or cellar, which was piled all round with crates and massive boxes.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('168','Donna','2020','8','5','Mr. Windibank gave a violent start and dropped his gloves. I am delighted to hear it, he said.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('169','Keith','2020','8','6','Nor from below, said Mr. Merryweather, striking his stick upon the flags which lined the floor. Why, dear me, it sounds quite hollow! he remarked, looking up in surprise.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('170','Linda','2020','8','6','Oh, that! I thought of the salt that I have been working upon. There was never any mystery in the matter, though, as I said yesterday, some of the details are of interest. The only drawback is that there is no law, I fear, that can touch the scoundrel.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('171','Russell','2020','8','7','As he spoke there was a tap at the door, and the boy in buttons entered to announce Miss Mary Sutherland, while the lady herself loomed behind his small black figure like a full-sailed merchant-man behind a tiny pilot boat. Sherlock Holmes welcomed her with the easy courtesy for which he was remarkable, and, having closed the door and bowed her into an armchair, he looked her over in the minute and yet abstracted fashion which was peculiar to him.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('172','Susan','2020','8','10','Oh, she has turned all the mens heads down in that part. She is the daintiest thing under a bonnet on this planet. So say the Serpentine-mews, to a man. She lives quietly, sings at concerts, drives out at five every day, and returns at seven sharp for dinner. Seldom goes out at other times, except when she sings. Has only one male visitor, but a good deal of him. He is dark, handsome, and dashing, never calls less than once a day, and often twice. He is a Mr. Godfrey Norton, of the Inner Temple. See the advantages of a cabman as a confidant. They had driven him home a dozen times from Serpentine-mews, and knew all about him. When I had listened to all they had to tell, I began to walk up and down near Briony Lodge once more, and to think over my plan of campaign.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('173','Roy','2020','8','10','Yes, sir. I met him that night, and he called next day to ask if we had got home all safe, and after that we met himthat is to say, Mr. Holmes, I met him twice for walks, but after that father came back again, and Mr. Hosmer Angel could not come to the house any more.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('174','Adam','2020','8','11','He had risen from his chair and was standing between the parted blinds gazing down into the dull neutral-tinted London street. Looking over his shoulder, I saw that on the pavement opposite there stood a large woman with a heavy fur boa round her neck, and a large curling red feather in a broad-brimmed hat which was tilted in a coquettish Duchess of Devonshire fashion over her ear. From under this great panoply she peeped up in a nervous, hesitating fashion at our windows, while her body oscillated backward and forward, and her fingers fidgeted with her glove buttons. Suddenly, with a plunge, as of the swimmer who leaves the bank, she hurried across the road, and we heard the sharp clang of the bell.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('175','Kelly','2020','8','12','Then, pray consult, said Holmes, shutting his eyes once more.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('176','Rebecca','2020','8','12','The man who entered was a sturdy, middle-sized fellow, some thirty years of age, clean-shaven, and sallow-skinned, with a bland, insinuating manner, and a pair of wonderfully sharp and penetrating grey eyes. He shot a questioning glance at each of us, placed his shiny top-hat upon the sideboard, and with a slight bow sidled down into the nearest chair.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('177','Gary','2020','8','13','I hope that I may have the pleasure of introducing you to-night. Ive had one or two little turns also with Mr. John Clay, and I agree with you that he is at the head of his profession. It is past ten, however, and quite time that we started. If you two will take the first hansom, Watson and I will follow in the second.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('178','Christian','2020','8','13','Well, really! he cried, and then he choked and laughed again until he was obliged to lie back, limp and helpless, in the chair.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('179','Maria','2020','8','14','Not so many as you might think, he answered. You see it is really confined to Londoners, and to grown men. This American had started from London when he was young, and he wanted to do the old town a good turn. Then, again, I have heard it is no use your applying if your hair is light red, or dark red, or anything but real bright, blazing, fiery red. Now, if you cared to apply, Mr. Wilson, you would just walk in; but perhaps it would hardly be worth your while to put yourself out of the way for the sake of a few hundred pounds.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('180','Amanda','2020','8','19','You want to go home, no doubt, Doctor, he remarked as we emerged.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('181','Christine','2020','8','20','I cannot say that I do unless it were that he wished to be able to deny his signature if an action for breach of promise were instituted.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('182','Bradley','2020','8','21','This is a very unexpected turn of affairs, said I; and what then?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('183','Marie','2020','8','22','It was all-important. When a woman thinks that her house is on fire, her instinct is at once to rush to the thing which she values most. It is a perfectly overpowering impulse, and I have more than once taken advantage of it. In the case of the Darlington Substitution Scandal it was of use to me, and also in the Arnsworth Castle business. A married woman grabs at her baby; an unmarried one reaches for her jewel-box. Now it was clear to me that our lady of to-day had nothing in the house more precious to her than what we are in quest of. She would rush to secure it. The alarm of fire was admirably done. The smoke and shouting were enough to shake nerves of steel. She responded beautifully. The photograph is in a recess behind a sliding panel just above the right bell-pull. She was there in an instant, and I caught a glimpse of it as she half drew it out. When I cried out that it was a false alarm, she replaced it, glanced at the rocket, rushed from the room, and I have not seen her since. I rose, and, making my excuses, escaped from the house. I hesitated whether to attempt to secure the photograph at once; but the coachman had come in, and as he was watching me narrowly, it seemed safer to wait. A little over-precipitance may ruin all.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('184','Amy','2020','8','22','Oh, indeed! You seem to have done the thing very completely. I must compliment you.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('185','Virginia','2020','8','23','Yes, sir. I am afraid that I am a little late, but I am not quite my own master, you know. I am sorry that Miss Sutherland has troubled you about this little matter, for I think it is far better not to wash linen of the sort in public. It was quite against my wishes that she came, but she is a very excitable, impulsive girl, as you may have noticed, and she is not easily controlled when she has made up her mind on a point. Of course, I did not mind you so much, as you are not connected with the official police, but it is not pleasant to have a family misfortune like this noised abroad. Besides, it is a useless expense, for how could you possibly find this Hosmer Angel?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('186','Daniel','2020','8','23','As he spoke the gleam of the sidelights of a carriage came round the curve of the avenue. It was a smart little landau which rattled up to the door of Briony Lodge. As it pulled up, one of the loafing men at the corner dashed forward to open the door in the hope of earning a copper, but was elbowed away by another loafer, who had rushed up with the same intention. A fierce quarrel broke out, which was increased by the two guardsmen, who took sides with one of the loungers, and by the scissors-grinder, who was equally hot upon the other side. A blow was struck, and in an instant the lady, who had stepped from her carriage, was the centre of a little knot of flushed and struggling men, who struck savagely at each other with their fists and sticks. Holmes dashed into the crowd to protect the lady; but, just as he reached her, he gave a cry and dropped to the ground, with the blood running freely down his face. At his fall the guardsmen took to their heels in one direction and the loungers in the other, while a number of better dressed people, who had watched the scuffle without taking part in it, crowded in to help the lady and to attend to the injured man. Irene Adler, as I will still call her, had hurried up the steps; but she stood at the top with her superb figure outlined against the lights of the hall, looking back into the street.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('187','Joe','2020','8','23','It was a quarter past six when we left Baker Street, and it still wanted ten minutes to the hour when we found ourselves in Serpentine Avenue. It was already dusk, and the lamps were just being lighted as we paced up and down in front of Briony Lodge, waiting for the coming of its occupant. The house was just such as I had pictured it from Sherlock Holmes succinct description, but the locality appeared to be less private than I expected. On the contrary, for a small street in a quiet neighbourhood, it was remarkably animated. There was a group of shabbily dressed men smoking and laughing in a corner, a scissors-grinder with his wheel, two guardsmen who were flirting with a nurse-girl, and several well-dressed young men who were lounging up and down with cigars in their mouths.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('188','Janet','2020','8','24','Your own little income, he asked, does it come out of the business?');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('189','Angela','2020','8','26','And I you, Holmes answered. Your red-headed idea was very new and effective.');
INSERT INTO "interviews" ("id","name","year","month","day","transcript") VALUES ('190','Diane','2020','8','27','It would be injustice to hesitate, said he. You will, however, I am sure, excuse me for taking an obvious precaution. With that he seized my hair in both his hands, and tugged until I yelled with the pain. There is water in your eyes, said he as he released me. I perceive that all is as it should be. But we have to be careful, for we have twice been deceived by wigs and once by paint. I could tell you tales of cobblers wax which would disgust you with human nature. He stepped over to the window and shouted through it at the top of his voice that the vacancy was filled. A groan of disappointment came up from below, and the folk all trooped away in different directions until there was not a red-head to be seen except my own and that of the manager.');
